import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  justify-content: space-between;

  align-items: center;
  width: 100%;
`;

const Contents = styled.div`
  width: 300px;
  border: 1px solid red;
  height: 200px;
`;

const PricingPolicy = () => {
  return (
    <Container>
      <Contents>A</Contents>
      <Contents>A</Contents>
      <Contents>A</Contents>
    </Container>
  );
};

export default PricingPolicy;
